('2319','15','7864','Finca Cerdo',Null,'Pferdehof Nähe Manacor zu verkaufen','32750','Dieser Pferdehof steht auf einem ca 135.000m² grossen , flachen Grundstück. Erstellt wurden bereits ein Haupthaus mit 2 Etagen und ca 380m² Wohnfläche (zum Teil noch nicht ausgebaut), ein Gebäude mit 16 Pferdeboxen, Sattelkammer, überdachter Pferdewaschplatz, Futterlager, ein Apartment und eine Garage für 3 Autos. Der 4.900m² grosse Trainingsplatz ist mit einer Sprinkleranlage und Flutlicht ausgestattet. Ein Tiefbrunnen versorgt die Finca mit ausreichen Wasser. Stromanschluss ist vorhanden. Die Behörde würden, laut Aussagen des Verkäufers, den Bau weitere 2.500m² Nutzfläche, sowie eine Lizenz für ein Landhotel genehmigen','32751','1500000','106','2015-04-08 14:09:04','106','2015-04-08 14:10:05',Null,'2371','100','1117',1,'1','0',Null,Null,Null,'32752',Null,'0','0','0',Null,'2015-04-08 14:14:07',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'32753',Null,'32754',Null,'32755',Null,'32756','678604019','32757','0',0,'6');
